import { Container } from '../Layout/';
import { Navigator } from '../Navigator/';
import { Link } from '../Link/';
import { Logo } from '../Logo/';
import { List, ListItem } from '../List/';

export function Header(props)
{
    return(
        <header>
            {props.children}
        </header>
    )
}

export function NavMenu()
{
    return(
        <Header>
            <Navigator>
                <Logo />

                <List>
                    <ListItem>
                        <Link>Soluções</Link>
                    </ListItem>

                    <ListItem>
                        <Link>Sobre nós</Link>
                    </ListItem>

                    <ListItem>
                        <Link>Contato</Link>
                    </ListItem>

                    <ListItem>
                        <Link>Vagas</Link>
                    </ListItem>
                </List>
            </Navigator>
        </Header>
    )
}
